import HeaderLog from '../../images/logo.svg'

function Header() {

  return (
    <div className="header">
      <div className='header_container'>
        <image className="logo logo_place_header" src={HeaderLog} alt="Круг" />
        <div className="navigation">
          <div className="navigation__profail navigation__profail_private"></div>
          <button className="navigation__register">Регистрацич</button>
          <button className="navigation__aut">Войти</button>
        </div>
      </div>
    </div>
  )
}

export default Header;
